import React, { Component } from "react"
import App from "./App"

import { Header, Icon } from "semantic-ui-react"

class Main extends Component {
  render() {
    return (
      <div>
        <Header as="h2">
          <Icon name="plug" />
          <Header.Content>Uptime Guarantee</Header.Content>
        </Header>
        <App></App>
      </div>
    )
  }
}

export default Main
